(4894, 440, 'passos_modo_preparo_produto_1_texto_passo_modo_preparo_produto', '<strong>Churrasqueira:</strong>\r\nAsse o Pão de alho tradicional da Boa por aproximadamente 1 minuto com o corte para baixo e vire o pão. Asse por aproximadamente 2 a 3 minutos com o corte para cima e vire o pão. Com o corte para baixo, doure. '),
