(3, 1, '2019-09-16 14:57:22', '2019-09-16 17:57:22', '<!-- wp:paragraph -->\n<p>Nomeada pelos próprios clientes em reconhecimento a qualidade de seus\n produtos surge a empresa \"Massas Da Boa\", inicialmente voltada à \nprodução de massa para pastel. Atualmente trabalhamos com uma pauta \nvariada de produtos e temos este reconhecimento expandido a todo estado \nde Santa Catarina e parte do Paraná através de uma equipe de vendedores \ndiretos e veículos próprios refrigerados.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Somos uma das maiores empresas de massas frescas de Santa \nCatarina tendo alcançado este lugar pela atenção constante a qualidade \nde nossos produtos e por um relacionamento próximo de nossos clientes.</p>\n<!-- /wp:paragraph -->', 'Sobre Nós', '“Nossa missão é alcançar a liderança de mercado no segmento de massas frescas em Santa Catarina sendo referência pela qualidade de nossos produtos e pelo aprimoramento contínuo de nossos serviços\".', 'publish', 'closed', 'open', '', 'sobre-nos', '', '', '2019-11-13 15:02:41', '2019-11-13 17:02:41', '', 0, 'http://localhost/daboa/?page_id=3', 0, 'page', '', 0),
